prediction.sparql:
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?supplier ( AVG( ?reliability ) AS ?avgReliability ) ( SAMPLE( ?labelRaw ) AS ?label ) ( SAMPLE( ?nameRaw ) AS ?name ) WHERE {
  ?product pv:hasSupplier ?supplier ; pv:reliabilityIndex ?reliability .
  OPTIONAL {
    ?supplier rdfs:label ?labelRaw
  }
  OPTIONAL {
    ?supplier pv:name ?nameRaw
  }
}
GROUP BY ?supplier
ORDER BY DESC ( ?avgReliability )
LIMIT 5

SELECT ?category (COUNT(?product) AS ?productCount) WHERE {
  ?product pv:hasCategory ?category .
} GROUP BY ?category ORDER BY DESC(?productCount) LIMIT 1

# Top 3 skills (other areas of expertise) for agents with expertise in Compensator
SELECT ?otherCategory ?label (COUNT(?agent) AS ?agentCount) WHERE {
  ?agent pv:areaOfExpertise prodi:prod-cat-Compensator ;
         pv:areaOfExpertise ?otherCategory .
  FILTER(?otherCategory != prodi:prod-cat-Compensator)
  OPTIONAL { ?otherCategory rdfs:label ?label }
} GROUP BY ?otherCategory ?label ORDER BY DESC(?agentCount) LIMIT 3

PREFIX prodi: <http://ld.company.org/prod-instances/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?compatibleProduct ?label WHERE {
  prodi:hw-U990-5234138 pv:compatibleProduct ?compatibleProduct .
  OPTIONAL {
    ?compatibleProduct rdfs:label ?label
  }
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT ?hw ?id ?name ?width WHERE {
  ?hw rdf:type pv:Hardware .
  ?hw pv:width_mm ?width .
  OPTIONAL {
    ?hw pv:id ?id
  }
  OPTIONAL {
    ?hw pv:name ?name
  }
}
ORDER BY DESC ( ?width )
LIMIT 100

SELECT ?department WHERE {
  <http://ld.company.org/prod-instances/empl-Karen.Brant@company.org> ?p ?department
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
SELECT ?empl ( REPLACE( STRAFTER( STR( ?empl ) , "empl-" ) , "%40company.org" , "" ) AS ?name ) ?email ?phone WHERE {
  ?empl a pv:Employee .
  OPTIONAL {
    ?empl pv:email ?email
  }
  OPTIONAL {
    ?empl pv:phone ?phone
  }
  FILTER NOT EXISTS {
    ?x pv:hasManager ?empl
  }
}
ORDER BY ?name

PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?dept ( COUNT( ?emp ) AS ?numEmployees ) ( SAMPLE( ?label ) AS ?deptLabel ) WHERE {
  ?dept a pv:Department .
  OPTIONAL {
    ?dept rdfs:label ?label
  }
  ?emp a pv:Employee ; pv:memberOf ?dept .
}
GROUP BY ?dept
HAVING ( COUNT( ?emp ) > 5 )

PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?category ?categoryLabel ?lightest ?lightestLabel ?lightestWeight ?heaviest ?heaviestLabel ?heaviestWeight WHERE {
  {
    SELECT ?category ( MIN( ?weight ) AS ?minWeight ) ( MAX( ?weight ) AS ?maxWeight ) WHERE {
      ?hardware a pv:Hardware ; pv:hasCategory ?category ; pv:weight_g ?weight .
    }
    GROUP BY ?category
  }
  OPTIONAL {
    ?lightest a pv:Hardware ; pv:hasCategory ?category ; pv:weight_g ?lightestWeight .
    FILTER ( ?lightestWeight = ?minWeight ) OPTIONAL {
      ?lightest rdfs:label ?lightestLabel
    }
  }
  OPTIONAL {
    ?heaviest a pv:Hardware ; pv:hasCategory ?category ; pv:weight_g ?heaviestWeight .
    FILTER ( ?heaviestWeight = ?maxWeight ) OPTIONAL {
      ?heaviest rdfs:label ?heaviestLabel
    }
  }
  OPTIONAL {
    ?category rdfs:label ?categoryLabel
  }
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?bom ?label WHERE {
  ?bom a pv:BillOfMaterial ; rdfs:label ?label
