SELECT ?manager ?managerLabel WHERE {
  VALUES ?employee {
    <http://ld.company.org/prod-instances/empl-Heinrich.Hoch%40company.org>
  }
  ?employee pv:hasManager ?manager .
  OPTIONAL {
    ?manager rdfs:label ?managerLabel
  }
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?hardware ?label ?width ?height ?depth WHERE {
  ?hardware rdf:type pv:Hardware ; pv:width_mm ?width ; pv:height_mm ?height ; pv:depth_mm ?depth .
  FILTER ( ?width > ?height ) FILTER ( ?depth < 50 ) OPTIONAL {
    ?hardware rdfs:label ?label
  }
}

PREFIX prodi: <http://ld.company.org/prod-instances/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
SELECT ( COUNT( DISTINCT ?supplier ) AS ?supplierCount ) WHERE {
  VALUES ?product {
    prodi:hw-T808-9704137 prodi:hw-C119-5354812 prodi:hw-K845-4116844 prodi:hw-Q248-7597886 prodi:hw-R658-8902629 prodi:hw-S271-9518696
  }
  ?product pv:hasSupplier ?supplier .
}

PREFIX prodi: <http://ld.company.org/prod-instances/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?agent ?agentLabel WHERE {
  ?agent pv:areaOfExpertise prodi:prod-cat-Transistor .
  OPTIONAL {
    ?agent rdfs:label ?agentLabel
  }
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?product ?productLabel ?compatible ?compatibleLabel ?amount1 ?amount2 ( ?amount1 - ?amount2 AS ?priceDifference ) ?currency1 ?currency2 WHERE {
  ?product a pv:Hardware ; pv:compatibleProduct ?compatible ; pv:price ?price1 .
  ?compatible pv:price ?price2 .
  ?price1 pv:amount ?amount1 ; pv:currency ?currency1 .
  ?price2 pv:amount ?amount2 ; pv:currency ?currency2 .
  OPTIONAL {
    ?product rdfs:label ?productLabel
  }
  OPTIONAL {
    ?compatible rdfs:label ?compatibleLabel
  }
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?bom ( COUNT( ?bomPart ) AS ?numParts ) ( SUM( xsd:integer ( ?quantity ) ) AS ?totalQuantity ) ?label ?name WHERE {
  ?bom a pv:BillOfMaterial .
  OPTIONAL {
    ?bom rdfs:label ?label
  }
  OPTIONAL {
    ?bom pv:name ?name
  }
  ?bom pv:hasBomPart ?bomPart .
  ?bomPart pv:quantity ?quantity .
}
GROUP BY ?bom ?label ?name
HAVING ( SUM( xsd:integer ( ?quantity ) ) > 600 )
ORDER BY DESC ( ?totalQuantity )

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?service ?serviceLabel ?department ?departmentLabel ?amount WHERE {
  ?service a pv:Service .
  OPTIONAL {
    ?service rdfs:label ?serviceLabel
  }
  ?service pv:price ?price .
  ?price pv:amount ?amount .
  ?department pv:responsibleFor ?service .
  OPTIONAL {
    ?department rdfs:label ?departmentLabel
  }
}
ORDER BY DESC ( xsd:decimal ( ?amount ) )
LIMIT 1

PREFIX prodi: <http://ld.company.org/prod-instances/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?department ?departmentLabel WHERE {
  ?employee pv:areaOfExpertise prodi:prod-cat-Transducer .
  ?employee pv:memberOf ?department .
  OPTIONAL {
