  }
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
SELECT ?department WHERE {
  ?department a pv:Department .
  FILTER NOT EXISTS {
    ?manager a pv:Manager ; pv:memberOf ?department .
  }
}

PREFIX wgs84: <http://www.w3.org/2003/01/geo/wgs84_pos#>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?supplier ?name ?label ?addressText ?addressCountry ?addressCountryCode ?addressLocality ?lat ?long ?country WHERE {
  ?supplier rdf:type pv:Supplier .
  OPTIONAL {
    ?supplier pv:name ?name
  }
  OPTIONAL {
    ?supplier rdfs:label ?label
  }
  OPTIONAL {
    ?supplier pv:addressText ?addressText
  }
  OPTIONAL {
    ?supplier pv:addressCountry ?addressCountry
  }
  OPTIONAL {
    ?supplier pv:addressCountryCode ?addressCountryCode
  }
  OPTIONAL {
    ?supplier pv:addressLocality ?addressLocality
  }
  OPTIONAL {
    ?supplier wgs84:lat ?lat
  }
  OPTIONAL {
    ?supplier wgs84:long ?long
  }
  OPTIONAL {
    ?supplier pv:country ?country
  }
}

PREFIX pv: <http://ld.company.org/prod-vocab/>
SELECT ?manager ?managerDept ?teamSize ?sameDeptCount ( ( ?sameDeptCount * 100.0 ) / ?teamSize AS ?percentage ) WHERE {
  {
    SELECT ?manager ( COUNT( ?teamMember ) AS ?teamSize ) WHERE {
      ?teamMember pv:hasManager ?manager .
    }
    GROUP BY ?manager
  }
  {
    SELECT ?manager ( COUNT( ?teamMember ) AS ?sameDeptCount ) WHERE {
      ?teamMember pv:hasManager ?manager .
      ?teamMember pv:memberOf ?dept .
      ?manager pv:memberOf ?dept .
    }
    GROUP BY ?manager
  }
  ?manager pv:memberOf ?managerDept .
}

