PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX dbpedia: <http://dbpedia.org/resource/>
SELECT DISTINCT ?bom ?bomLabel WHERE {
  ?bom a ?bomType .
  ?bom pv:hasBomPart ?bomPart .
  ?bomPart pv:hasPart ?product .
  ?product pv:hasSupplier ?supplier .
  ?supplier pv:country dbpedia:Poland .
  OPTIONAL {
    ?bom rdfs:label ?bomLabel
  }
}

PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?employee ?employeeLabel ?employeeName ?employeeFoafName ?email ?phone ?department ?departmentLabel ?manager ?managerLabel ?managerName ?managerFoafName WHERE {
  ?employee a pv:Employee .
  OPTIONAL {
    ?employee rdfs:label ?employeeLabel .
  }
  OPTIONAL {
    ?employee pv:name ?employeeName .
  }
  OPTIONAL {
    ?employee foaf:name ?employeeFoafName .
  }
  OPTIONAL {
    ?employee pv:email ?email .
  }
  OPTIONAL {
    ?employee pv:phone ?phone .
  }
  OPTIONAL {
    ?employee pv:memberOf ?department .
    OPTIONAL {
      ?department rdfs:label ?departmentLabel .
    }
  }
  OPTIONAL {
    ?employee pv:hasManager ?manager .
    OPTIONAL {
      ?manager rdfs:label ?managerLabel .
    }
    OPTIONAL {
      ?manager pv:name ?managerName .
    }
    OPTIONAL {
      ?manager foaf:name ?managerFoafName .
    }
  }
}

