PREFIX dbpedia: <http://dbpedia.org/resource/>
PREFIX prodi: <http://ld.company.org/prod-instances/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?product ?supplier ?amount ?currency ?productLabel ?supplierLabel WHERE {
  ?product pv:hasCategory prodi:prod-cat-Encoder ; pv:hasSupplier ?supplier ; pv:price ?price .
  ?supplier pv:country ?country .
  ?price pv:amount ?amount ; pv:currency ?currency .
  OPTIONAL {
    ?product rdfs:label ?productLabel
  }
  OPTIONAL {
    ?supplier rdfs:label ?supplierLabel
  }
  FILTER ( ?country IN ( dbpedia:France , dbpedia:Germany ) )
}
ORDER BY ASC ( ?amount )
LIMIT 1

