PREFIX pv: <http://ld.company.org/prod-vocab/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?hardware ?hardwareLabel ?supplier ?supplierName ?supplierCountry ?price ?currency WHERE {
  ?hardware rdf:type pv:Hardware .
  OPTIONAL {
    ?hardware rdfs:label ?hardwareLabel
  }
  ?hardware pv:price ?priceEntity .
  ?priceEntity pv:amount ?price .
  ?priceEntity pv:currency ?currency .
  ?hardware pv:hasSupplier ?supplier .
  OPTIONAL {
    ?supplier pv:name ?supplierName
  }
  OPTIONAL {
    ?supplier pv:addressCountry ?supplierCountry
  }
}
ORDER BY DESC ( ?price )
OFFSET 5
LIMIT 5

